import React, { useState, useEffect } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';
import { Button } from '@/components/ui/button';
import { Tabs, TabsList, TabsTrigger, TabsContent } from '@/components/ui/tabs';
import { Alert, AlertDescription } from '@/components/ui/alert';
import { Loader2 } from 'lucide-react';

// Mock data - replace with actual API calls
const mockData = [
  {
    id: 1,
    title: "Thailand Adventure",
    description: "Explore the beautiful beaches and temples of Thailand",
    duration_days: 7,
    base_price: 1299.99,
    destination: "Thailand",
    totalUsers: 2854
  },
  {
    id: 2,
    title: "Japan Cultural Tour",
    description: "Experience the rich culture and history of Japan",
    duration_days: 10,
    base_price: 2499.99,
    destination: "Japan",
    totalUsers: 2960
  }
];

const App = () => {
  const [packages, setPackages] = useState(mockData);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [activeTab, setActiveTab] = useState('packages');

  const fetchPackages = async () => {
    setLoading(true);
    try {
      // In a real app, this would be an API call
      // For now, we'll simulate an API delay
      await new Promise(resolve => setTimeout(resolve, 1000));
      setPackages(mockData);
      setError(null);
    } catch (err) {
      setError('Failed to fetch packages. Please try again later.');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchPackages();
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="max-w-7xl mx-auto">
        <div className="mb-8">
          <h1 className="text-3xl font-bold text-gray-900">TBO Travel Agent Portal</h1>
          <p className="text-gray-600 mt-2">Manage your travel packages and bookings</p>
        </div>

        <Tabs defaultValue={activeTab} onValueChange={setActiveTab} className="w-full">
          <TabsList>
            <TabsTrigger value="packages">Packages</TabsTrigger>
            <TabsTrigger value="bookings">Bookings</TabsTrigger>
            <TabsTrigger value="customers">Customers</TabsTrigger>
          </TabsList>

          <TabsContent value="packages" className="mt-6">
            {error && (
              <Alert variant="destructive" className="mb-6">
                <AlertDescription>{error}</AlertDescription>
              </Alert>
            )}

            {loading ? (
              <div className="flex items-center justify-center p-8">
                <Loader2 className="h-8 w-8 animate-spin" />
              </div>
            ) : (
              <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
                {packages.map((pkg) => (
                  <Card key={pkg.id} className="hover:shadow-lg transition-shadow">
                    <CardHeader>
                      <CardTitle className="flex justify-between items-start">
                        <span>{pkg.title}</span>
                        <span className="text-sm font-normal text-gray-500">
                          {pkg.duration_days} days
                        </span>
                      </CardTitle>
                    </CardHeader>
                    <CardContent>
                      <div className="space-y-4">
                        <p className="text-gray-600">{pkg.description}</p>
                        <div className="flex justify-between items-center">
                          <p className="text-2xl font-bold">${pkg.base_price}</p>
                          <Button variant="outline" size="sm">
                            View Details
                          </Button>
                        </div>
                        <div className="flex justify-between text-sm text-gray-500">
                          <span>Destination: {pkg.destination}</span>
                          <span>{pkg.totalUsers} bookings</span>
                        </div>
                      </div>
                    </CardContent>
                  </Card>
                ))}
              </div>
            )}
          </TabsContent>

          <TabsContent value="bookings" className="mt-6">
            <Card>
              <CardHeader>
                <CardTitle>Bookings</CardTitle>
              </CardHeader>
              <CardContent>
                <p>Bookings management coming soon...</p>
              </CardContent>
            </Card>
          </TabsContent>

          <TabsContent value="customers" className="mt-6">
            <Card>
              <CardHeader>
                <CardTitle>Customers</CardTitle>
              </CardHeader>
              <CardContent>
                <p>Customer management coming soon...</p>
              </CardContent>
            </Card>
          </TabsContent>
        </Tabs>
      </div>
    </div>
  );
};

export default App;
